import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { useNavigation } from "@react-navigation/native";

function ChatsScreen(props) {
  const navigation = useNavigation();

  const addchat = () => {
    navigation.navigate('addchat');
  }
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Chats</Text>

      <TouchableOpacity style={styles.button} onPress={addchat} >
                <Text style={styles.buttonText}>Add Chat</Text>
            </TouchableOpacity>
            <View style={styles.container}>

     <img style={{ width: 100, height: 100, display: 'flex', marginLeft: 30, marginBottom: 30, }} src={imageSrc}></img>
     <Text style={styles.title}>Account Details</Text>
     <Text style={styles.label}>ID:</Text>
     {user.user_id && <TextInput style={styles.input} value={user.user_id.toString()} editable={false} />}
     <Text style={styles.label}>First Name:</Text>
     {user.first_name && <TextInput style={styles.input} value={user.first_name} editable={false} />}
     <Text style={styles.label}>Last Name:</Text>
     {user.last_name && <TextInput style={styles.input} value={user.last_name} editable={false} />}
     <Text style={styles.label}>Email:</Text>
     {user.email && <TextInput style={styles.input} value={user.email} editable={false} />}
     <TouchableOpacity
       style={styles.button}
       onPress={() => navigation.goBack()}
     >
       <Text style={styles.buttonText}>Back</Text>
     </TouchableOpacity>
   </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#808000',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
});

export default ChatsScreen;
